-- ----------------------------
-- View structure for customerviplevelinfo
-- ----------------------------
DROP VIEW IF EXISTS `customerviplevelinfo`;
CREATE ALGORITHM = UNDEFINED SQL SECURITY DEFINER VIEW `customerviplevelinfo` AS select `customers`.`customerIDCard` AS `customerIDCard`,`customers`.`customerGender` AS `customerGender`,`customers`.`customerName` AS `customerName`,`customers`.`customerBirthday` AS `customerBirthday`,`customers`.`customerVIPLevel` AS `customerVIPLevel`,`customers`.`customerPhoneNumber` AS `customerPhoneNumber`,`customers`.`totalAmount` AS `totalAmount`,`customers`.`remarks` AS `remarks`,`viplevel`.`discount` AS `discount` from (`customers` join `viplevel`) where (`customers`.`customerVIPLevel` = `viplevel`.`level`);

-- ----------------------------
-- View structure for incomeview
-- ----------------------------
DROP VIEW IF EXISTS `incomeview`;
CREATE ALGORITHM = UNDEFINED SQL SECURITY DEFINER VIEW `incomeview` AS select `orders`.`checkOutTime` AS `co`,sum(`orders`.`totalMoney`) AS `tot`,count(0) AS `num` from `orders` where `orders`.`orderNumber` in (select `ordertracking`.`orderNumber` from `ordertracking` where (`ordertracking`.`checkOutTime` is not null)) group by `co`;

-- ----------------------------
-- View structure for orderviews
-- ----------------------------
DROP VIEW IF EXISTS `orderviews`;
CREATE ALGORITHM = UNDEFINED SQL SECURITY DEFINER VIEW `orderviews` AS select `orders`.`orderNumber` AS `orderNumber`,`orders`.`orderStatus` AS `orderStatus`,`customers`.`customerName` AS `customerName`,`room`.`roomNumber` AS `roomNumber`,`room`.`roomType` AS `roomType`,`orders`.`orderTime` AS `orderTime`,`orders`.`checkInTime` AS `checkInTime`,`orders`.`checkOutTime` AS `checkOutTime`,`customers`.`customerPhoneNumber` AS `customerPhoneNumber`,`orders`.`totalMoney` AS `totalMoney` from (((`orders` join `room`) join `customers`) join `roomtypeandprice`) where ((`orders`.`customerIDCard` = `customers`.`customerIDCard`) and (`room`.`roomType` = `roomtypeandprice`.`roomType`) and (`orders`.`roomNumber` = `room`.`roomNumber`)) order by `orders`.`orderNumber` desc;

-- ----------------------------
-- View structure for roominfo
-- ----------------------------
DROP VIEW IF EXISTS `roominfo`;
CREATE ALGORITHM = UNDEFINED SQL SECURITY DEFINER VIEW `roominfo` AS select `room`.`roomNumber` AS `roomNumber`,`room`.`roomType` AS `roomType`,`room`.`roomStatus` AS `roomStatus`,`room`.`remarks` AS `remarks`,`rp`.`price` AS `price`,`rp`.`desc` AS `desc`,`rp`.`url` AS `url` from (`room` join `roomtypeandprice` `rp`) where (`room`.`roomType` = `rp`.`roomType`);

-- ----------------------------
-- View structure for timeextensionordersview
-- ----------------------------
DROP VIEW IF EXISTS `timeextensionordersview`;
CREATE ALGORITHM = UNDEFINED SQL SECURITY DEFINER VIEW `timeextensionordersview` AS select `tt`.`orderNumber` AS `orderNumber`,`ct`.`customerName` AS `customerName`,`ct`.`customerPhoneNumber` AS `customerPhoneNumber`,`od`.`roomNumber` AS `roomNumber`,`od`.`checkInTime` AS `checkInTime`,`tt`.`oldExpiryDate` AS `oldExpiryDate`,`tt`.`newExpiryDate` AS `newExpiryDate`,`tt`.`addedMoney` AS `addedMoney` from ((`timeextension` `tt` join `orders` `od`) join `customers` `ct`) where ((`tt`.`orderNumber` = `od`.`orderNumber`) and (`od`.`customerIDCard` = `ct`.`customerIDCard`));

